import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Lesson_4 extends Component {
  render() {
    return (
      <div>
        <div class="lesson">
          <div class="lessonbody">
            <h5 class="chapterTitle"> Chapter 5: List </h5>
            <p> When you want a collection of something, you can use a list. Basically, list are the same as arrays. There is only one type of list in Vyper: fixed-sized list</p>

          </div>
        </div>
        <div class="editor">
        </div>
        <footer class="footer">
          <ul class="pagination right">
            <li class="waves-effect"><Link to="/lesson_3" ><i class="material-icons">chevron_left</i></Link></li>
            <li class="active"><a href="#!">5</a></li>
            <li class="waves-effect"><Link to="/lesson_5" ><i class="material-icons">chevron_right</i></Link></li>
        </ul>
        </footer>
      </div>
    )
  }
}
export default Lesson_4;
